    "2da85a87-2526-44f3-a3cf-1f68db8e4816": {"id":"2da85a87-2526-44f3-a3cf-1f68db8e4816","project_id":42644,"key":181120951,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2025-03-02T04:02:10.259Z","updated_at":"2025-03-02T04:02:10.259Z","props":{"useBackgroundControls":true,"content":"\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan class=\"css-8w529t-rules\" style=\"color:#c5d9ff\" data-type=\"color\"\u003eWhat better way to learn about me as an  \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003ch1 data-type=\"heading-one\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eL\u0026amp;D Manager \u003c/strong\u003e\u003c/p\u003e\u003c/h1\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003ch3 data-type=\"heading-three\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003ethan through my own design\u003c/strong\u003e\u003c/p\u003e\u003c/h3\u003e\u003c/div\u003e\u003cdiv class=\"chameleon-text-align-center\" data-type=\"textAlignCenter\"\u003e\u003cp data-type=\"paragraph\"\u003e(super stressful.....whose idea was this?) \u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003c/div\u003e","enableTextToSpeechBtn":true},"type":"Text"}, 
    "a536cb6b-87c5-4f34-b1f3-796e788003a1": {"id":"a536cb6b-87c5-4f34-b1f3-796e788003a1","project_id":42644,"key":181120948,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2025-03-02T04:01:49.899Z","updated_at":"2025-03-02T04:01:49.899Z","props":{"useBackgroundControls":true,"content":"\u003ch2 data-type=\"heading-two\"\u003e\u003cp data-type=\"paragraph\"\u003e\u003cstrong data-type=\"bold\"\u003eG\u0026#x27;day, I\u0026#x27;m Andrew \u003c/strong\u003e\u003c/p\u003e\u003c/h2\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003eMany \u003c/span\u003e\u003cspan class=\"css-wuezvu-rules\" style=\"color:#fff\" data-type=\"color\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003emoons\u003c/span\u003e\u003c/span\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003e ago I was in the world of Child Protection. It taught me some invaluable lessons about resilience, empathy and leadership that I keep with me today. I started from the bottom and progressed all the way to L\u0026amp;D Lead for QLD, managing a team of six. \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003eI\u0026#x27;m passionate about: \u003c/span\u003e\u003c/p\u003e\u003cp data-type=\"paragraph\"\u003e\u003c/p\u003e\u003cul class=\"chameleon-ul\" data-type=\"bulleted-list\"\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003eInstructional Design \u003c/span\u003e\u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003eLeadership\u003c/span\u003e\u003c/li\u003e\u003cli class=\"chameleon-li\" data-type=\"list-item\"\u003e\u003cspan style=\"font-size:1.125rem\" data-type=\"fontSize\"\u003eSeeing the \u0026quot;light-bulb\u0026quot; go on for people, regardless of what level they are at.\u003c/span\u003e\u003c/li\u003e\u003c/ul\u003e","enableTextToSpeechBtn":true},"type":"Text"}, 
    "e61934ec-1101-46d4-b733-e4d67c84a5b0": {"id":"e61934ec-1101-46d4-b733-e4d67c84a5b0","project_id":42644,"key":181120290,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2025-03-02T03:33:23.400Z","updated_at":"2025-03-02T03:33:23.400Z","props":{"useBackgroundControls":true,"enableTextToSpeechBtn":true,"content":"\u003cp data-type=\"paragraph\"\u003ePromoted change and innovation to our learning culture through the development of a landing page dubbed \u0026quot;Home of Learning\u0026quot; featuring a variety of curated content.\u003c/p\u003e"},"type":"Text"}, 
    "b3901e10-d555-4404-ae0b-c2348f3d9946": {"id":"b3901e10-d555-4404-ae0b-c2348f3d9946","project_id":42644,"key":181120288,"version":null,"meta":{},"children":[],"deleted_at":null,"created_at":"2025-03-02T03:33:09.821Z","updated_at":"2025-03-02T03:33:09.821Z","props":{"useBackgroundControls":true,"enableTextToSpeechBtn":true,"content":"\u003cp data-type=\"paragraph\"\u003eSat on the interview panel for ISO9001 audits and provided comprhensive and in depth explanations around our learning and development practices contributing to our successful compliance.  \u003c/p\u003e"},"type":"Text"}, 
